public class FindGreaterNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a = 10;
		int b = 16;
		
		if(a > b) {
			System.out.println("Greater num is :: "+a);
		}
		
		else {
			System.out.println("Greater num is :: "+b);
		}
		
	}

}
